class Header extends Component {
    render() {
        return (
            <div>
                <img src="https://yt3.ggpht.com/a-/AOh14GjWPBLQiJFl4MZ98bm19XRKlDTox1cv0Tj-CH5GNw=s88-c-k-c0xffffffff-no-rj-mo" alt=""></img>
                <h1>hello Header</h1>
            </div>
        );
    }
}

export default Header;
